 So, we need to use React Context to manage the state of the tooltip.

Here is a simple example of how you can create a tooltip in NextJS using React Context:

**Step 1: Create a new file for the context**

Create a new file called `tooltipContext.js` in the root of your project:
```jsx
import { createContext, useState } from 'react';

const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [activeTooltip, setActiveTooltip] = useState(null);

  const openTooltip = (id) => {
    setActiveTooltip(id);
  };

  const closeTooltip = () => {
    setActiveTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ activeTooltip, openTooltip, closeTooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export { TooltipProvider, TooltipContext };
```
In this file, we create a new context using `createContext` and a provider component `TooltipProvider` that wraps the app. The provider component uses the `useState` hook to manage the state of the active tooltip.

**Step 2: Wrap your app with the provider**

In your `pages/_app.js` file, wrap your app with the `TooltipProvider` component:
```jsx
import { TooltipProvider } from '../tooltipContext';

function MyApp({ Component, pageProps }) {
  return (
    <TooltipProvider>
      <Component {...pageProps} />
    </TooltipProvider>
  );
}

export default MyApp;
```
**Step 3: Create the tooltip component**

Create a new file called `Tooltip.js`:
```jsx
import { useContext } from 'react';
import { TooltipContext } from './tooltipContext';

const Tooltip = ({ id, children }) => {
  const { activeTooltip, openTooltip, closeTooltip } = useContext(TooltipContext);

  const handleClick = () => {
    if (activeTooltip === id) {
      closeTooltip();
    } else {
      openTooltip(id);
    }
  };

  return (
    <div>
      <button onClick={handleClick}>Show tooltip</button>
      {activeTooltip === id && (
        <div className="tooltip">
          {children}
        </div>
      )}
    </div>
  );
};

export default Tooltip;
```
In this file, we use the `useContext` hook to access the `activeTooltip`, `openTooltip`, and `closeTooltip` functions from the context. We also define a `handleClick` function that toggles the tooltip on and off.

**Step 4: Use the tooltip component**

Now you can use the `Tooltip` component in your pages:
```jsx
import Tooltip from '../components/Tooltip';

const Page = () => {
  return (
    <div>
      <Tooltip id="tooltip-1">
        <p>This is the content of the tooltip</p>
      </Tooltip>
      <Tooltip id="tooltip-2">
        <p>This is the content of another tooltip</p>
      </Tooltip>
    </div>
  );
};

export default Page;
```
In this example, we have two tooltips with different IDs. When you click on the button, the corresponding tooltip will be shown or hidden.

That's it! You now have a tooltip component that uses React Context to manage its state. When you click on a button, the previously opened tooltip will be closed, and the new one will be opened.

